"rating":"4.5",
"reviewcomment":"If you&#39;re ever in Frankfurt make sure you dine here! What a fun experience, and on top of that excellent food! I had never had African but can tell you this was delicious. Like other reviewers have said I would just go with the staff&#39;s recommendations, especially if you don&#39;t speak German. We had delicious lamb, spicy chicken, lentils, vegetables, potatoes and spinach. It&#39;s all piled on a round plate over yummy crepes you just use to grab everything with your hands -- no utensils required. <br><br>Besides the food, the atmosphere is another big draw. It really feels like you&#39;re in Africa, immersed in the culture. And definitely not in a cheesy way. Just go see for yourself!",
