"rating":"4.0",
"reviewcomment":"A friend of mine put me onto Cafe Karin and I&#39;m eternally grateful to her. It&#39;s just downright cozy, a bit like Chaos in Darmstadt, it has that shabby look. It offers the obligatory good cup of coffee (and a wide choice to keep me coming back) and if you have achey cakey pangs, they have a nice selection. Believe it or not if I&#39;m there in the afternoon I often have a mint tea instead of coffee (it&#39;s packed with fresh mint).<br><br> Admittedly, It&#39;s not right in the center, but it&#39;s worth the stroll. You can sit outside, if you don&#39;t mind the occasional insane motor cyclist whizzing past and if you can grab a seat.<br><br> The only downside is that they have stopped serving food a couple of times I&#39;ve been there. There seems to be a twilight hour in the late afternoon. Other than that it&#39;s great for breakfast, dinner and lunch.",
