"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/mWLCoQp64fYD1RCLjltAgA/l.jpg",
"rating":"4.0",
"reviewcomment":"Indeed the best gelateria in Frankfurt, at least among those I am aware of. Not the best gelato in the world, but certainly very good and seems to be made of natural ingredients. Flavours are therefore not very pronounced. Price/quality relationship is good, especially for Frankfurt: one gelato kugel costs 1 euro, but they make much bigger kugels than typical eiscafes in Germany.<br>Selection of flavours is reasonably wide and includes all the classics (for gelaterias in Germany).<br><br> On the negative side: somewhat remote location (3 mins by foot from U5 station Musterschule), not very friendly service and longish lines at peak times (e.g. when I visited on Saturday evening the line was more than 10 meters long).<br><br> Overall the best gelato in Frankfurt at a reasonable price.",
