"rating":"3.5",
"reviewcomment":"I agree with psyebbelwoi. This is the best Mexican restaurant that I have found in Germany, and it was a nice surprise for us; we couldn&#39;t get into the Mouson for a bite before the Tindersticks gig, so we went for a womble and found El Pacifico on the corner. We thought we&#39;d been a bit unlucky again, as it seemed full when we walked in (a good sign of course), but not to worry, they have another section to the side. Just past the giant lizard (no - I hadn&#39;t had a drop).<br><br> They have a nice wine list, you can order by the glass. The atmosphere is friendly and welcoming and you don&#39;t feel crammed in. Beyond the giant lizard the decor isn&#39;t OTT, oh and I loved the tables.<br><br> The hot chicken wings were the best we&#39;ve had in a long time, and yes they were spicy. :) My chicken burrito was delicious, it was spicy and no one had attempted to drown it in salad dressing (When will German chefs realise that salads can&#39;t swim?). Hubby&#39;s burger was good too. The only disappointment was they used Creme Fraiche instead of sour cream. It&#39;s probably the healthier option, but I don&#39;t do healthy.",
