"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ejwkfxqxHQxaDP4WNG9oiQ/l.jpg",
"rating":"3.0",
"reviewcomment":"I went there in search for a good Pad Thai. The restaurant is located on the top floor of a very modern shopping mall. Initially, I only wanted to capture the architecture up there but this nice little restaurant kept pulling me with its clean and appealing design and delicious scent.<br><br> The dishes are served with no spoon or fork. Instead, on the table there are enough pairs of chopsticks to take from. Some guests on neighboring tables chose to ask for western cutlery, though.<br><br> The waiters are very considerate, so be prepared to be asked several times, if you had ordered anything already or wanted to place your order now. My ear told me they spoke Mandarin Chinese when talking to one another, but anyway, my Thai dish was really excellent. Except the lime could have been a bit juicier. But that&#39;s very ok, given the overall taste and experience was so enjoyable to me.",
