"rating":"3.5",
"reviewcomment":"Also ich gehe immer wieder gerne ins MoschMosch, am liebsten esse ich das thaicurry mit frischem Gemüse und Hähnchen; absolut zu empfehlen. Wenn ich das nicht esse dann meistens das Rinderfilet mit Pfefferkruste, schön Rosa innen aufgeschnitten. <br>Man kann mit Kreditkarte bezahlen und wenn man nicht zu den typischsten Essenszeiten geht, dann muss man auch nicht reservieren.<br>Egal wieviel Reste ich noch habe, ich lasse sie mit immer einpacken. Am nächsten Tag aufgewärmt schmeckt sogar noch besser ;-) <br>Wichtig ist auch zu dem am Goetheplatz zu gehen, da dieser viel größer und sauberer als der andere in der Innenstadt ist. I always like to go to Mosch Mosch, my favorite is the Thai Curry with lots of fresh veggies and chicken; I can recommend it. If I am not eating that I&#39;ll eat the beef with pepper crust; pink in the middle, cut up in pieces.<br>You can pay with credit card and if you don&#39;t want to go there in the usual eating hours you don&#39;t really have to reserve.<br>It doesn&#39;t matter how much leftovers I have, I always get a doggy bag, because if you warm it up the next day it tastes even better.<br>Just remember to go to the one on Goeteplatz because the other one is not nearly as good.",
