"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/VFW1jJxkvsCrVyAsfJKaFg/l.jpg",
"rating":"3.5",
"reviewcomment":"This review is only for their breakfast. My husband was craving a real American breakfast. After some extensive googling, this was the best we could come up with in Frankfurt. We thought we&#39;d give it a shot.<br><br>As with most European restaurants, you just help yourself to a seat and wistfully hope a waiter notices you. Once we got the attention of a waiter, he took our order quickly. We ordered a simple breakfast of eggs, which was served with bread and butter. I wouldn&#39;t say it was a traditional American breakfast, but it did the trick. There were a few vegetarian options but not a lot. Overall, I&#39;d say that it was just okay. Their regular menu reminded me of a more limited version of a menu you would find at Ruby Tuesday. I doubt we&#39;d try it again. The location is central with limited street parking. However, there&#39;s lots of other restaurants nearby that look better. The bar is sizable, so it might be worth a stop in for a drink or two.",
