"categorystrlist":"Korean",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Z6hgYQkJJlcvrkxGI5lR3g/l.jpg",
"rating":"4.0",
"reviewcomment":"This is a great and authentic Korean restaurant. The staff is always very friendly and actually you will talk more to them than in a regular restaurant, as the menu is really small (only 4 different dishes), but there is always at least the same amount of additional dishes available, which are not on the menu. Same with desert and drinks (I had a delicous bamboo tea which is also not on the menu). Korean standard dishes like Bi-Bim-Bap or Bulgogi are very good and delicious as well.<br>Worth mentioning is also the furnishing: The complete interior is made from natural wood planks (tables, floor, ceiling, walls). I liked it very much, because it does not feel as cold as many other minimalistic/modern furnished places, but more cosy.<br>I will definately come back and can recommend this place!",
