"rating":"4.0",
"reviewcomment":"Great burgers! I&#39;m from Texas &amp; beef is... Actually, this place opened 5 days ago and all the kinks in the service dept. haven&#39;t been fully worked out. Neverthess, the folks running the joint are super friendly, helpful &amp; great cooks. They also speak English! The burgers are to die for. Juicy, thick, high quality beef patties with fixin&#39;s piled so high, barely got my mouth around the entire bun. The tomatoes, onions, etc were very fresh. Also, the bacon on my Otto Speck burger was crispy but not burnt. I find thier burgers a step above &#34;Die Kuh, die lacht&#34;. <br>I recommend also because the have free wifi for paying customers. The only problem I believe they&#39;ll need to overcome is their location, which is on the back side of Alt Sachsenhausen. Unless you know it&#39;s there, I imagine it&#39;ll be hard for many of the partiers to find. Nevertheless, I predict there are lots of officeworkers nearby that will flock to this place for lunch.",
