"categorystrlist":"Italian,         Pizza",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/1shrAvVkWLo5sgJ77PIYMw/l.jpg",
"rating":"3.5",
"reviewcomment":"First, the positive: the food is great! Pizza the way they make it in Italy and all the other dishes are to be recommended. The service is very good, considering how full the place always is. Decoration, layout, surroundings, and location are all very pleasant. Prices, for Frankfurt, are acceptable.<br>And now the BIG negative (and the reason I&#39;m deducting 3 stars): the music is entirely too loud! Table conversation is next to impossibleone has to shout to be heard. The guests at the other tables are all shouting to each other as wellthe manager is shouting to the waiters &amp; waitresses and they shout to each otherall this creates an ungodly din! When asked if she could turn the music down, the waitress informed us that this wasn&#39;t possible because it&#39;s programmed to be loud when there are a lot of guests and not quite so loud when fewer guests are there. This leads me to believe that their motto is: Eat.Pay.Get out! Profit, not the guests well-being, is No. 1 priority here. Sad",
