"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/fQHu6kv6oJWVMsesG1PPvw/l.jpg",
"rating":"3.5",
"reviewcomment":"The Zeil is the main shopping street in Frankfurt. It is very long: starting almost at the ZOO and going through to the Alte Oper (if you assume Fressgass is a part of it of course). All around you are shops and shops and more shops. It is not as expensive as Goethestrasse but still it has some very good shops. Be warned it is crowded during each time of the day. Especially on the weekends it is hard to walk, biking is virtually impossible although some extreme sport fans might actually enjoy it. During the weekends and the evening there are also many street musicians and artists so it is quite cool to go there and listen to music and watch the crowd go by. As a tourist it is a must place, but you are probably going to pass through it one way or the other it is regarded as the center of the city.<br>cheers",
