"rating":"3.0",
"reviewcomment":"All you can eat for €20! It was my first time eating sushi that comes on a conveyor belt..I was quite excited :D<br><br>As expected, with that type of business model, you&#39;re not going to get the best quality. The guy cuts the sushi in the middle space inside of the conveyor belt. However, the actual product looks pretty much nothing like the photo. If you don&#39;t see what you want, you can order with the waitress..if you can get her attention. Things like edamame and dessert are by request.<br><br>The front area seats about 20ish? They do have a private room in the back that seats 6-8, but they have to then cart the pieces to put on that separate conveyor belt.<br><br>Not bad for the price, but the quality is just really not great..and I guess I&#39;ve been spoiled by the superb quality of the places in New York.",
