"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/p7X8LX9NsODGZc_vcvrS6g/l.jpg",
"rating":"3.5",
"reviewcomment":"Frankfurt is not the greatest places to find a decent bite. So imagine my surprise when I was invited to dinner (admittedly this was last summer - so apologies for the late posting - but I actually went back again for more in the winter).<br><br>I can&#39;t really describe the menu as a particular genre. It&#39;s modern European cuisine I guess as I had duet of chanterelles with baked parsley powder in two jars (read posh mushroom soup - both visits) and honey truffled ravioli with walnuts and porcini on visit 1 and a vegetarian lasagne on visit 2. <br><br>The taste was BIG but the portions were SMALL and the price, somewhere in the middle of EXPENSIVE. I can&#39;t fault service though as it was attentive and sitting out on the veranda in the evening sun of August was relaxing. Sitting by the window in the winter, less satisfying but a lot warmer!<br><br>All in all it works out to be around €50 a head plus wine, which isn&#39;t exactly cheap, but then when in Germany there are wurst (ahem) places to eat!",
