"reviewcomment":"A trusted little Frankfurt Fellow recommended me this place as my better half and I looked for a good spot to spend the evening with some family &amp; relative members of his, the group originaly consisted of 5 adults (one pax  cancelled) with age range between 30 to 60 and 3 children under 12 yo,  during our short gateway in Frankfurt City. To make it even more complicated, it was the at the Final Night where Munich played Chelsea London at the Champhion Leaque.<br>-<br>As we didnt want to push our luck, we followed his advice and booked the table rite away.<br>-<br>It was empty at the restaurant area as we approached the venue, but well it was the big demonstration day (Blockuppy Frankfurt) where most of the streets and roads in and around Frankfurt City Center were closed and filled with tanks and police cars. (  But to ease your worry,  it was around 30 cheerfull pax having a very good time by 830 PM ).<br>-<br>The male staff guarded us to our table and nicely turned down the volume of the screen for our convinience. I grabbed the stylish silver menu card which looks like a bulletin (what a creative thoughts of having the menu n newsletter in one!!!)  and tried to find a cool start up.<br>-<br>Later on as we studied the card the staff said due to the Football Match they only served a selected menu with exceptional Pasta for the kids.<br>-<br>After putting my first cocktail order (hey, its happy hour from 5-8 PM : 5 bucks for any cocktails) I spelled my wish to get the Entrecote with Salad which turned to be hmm... nice! (that lil Frankfurt guy I mentioned at the beginning told us that MEAT is a must at this place). Generous size and premium quality, so the sassy missy was quite happy with the juicy Steak I guess. :P<br>-<br>How about the rest of our troop? The Kiddoz were spoiled by the homemade pasta (of course selfmade noodle - presented in front of their very eyes!) and my Folks enjoyed their Roastbeef happily.<br>-<br>As the night was stil very young, one by one, starting from the youngest member, we went to the front room/bar ordering and watching the live show of the most creative ice cream creation in Frankfurt (correct me if Im wrong).<br>-<br>I know you guys started to be bored with my fairy tale, so lemme sum up n end it with this:<br><br>+ Ultra friendly staffs! They just knew how to treat us rite, from the youngest to the most goodlooking. ;-)<br><br>+ Simple but pretty ambiance (minimalist)<br><br>+ Nice food (esp. Steak &amp; Ice Cream) &amp; Fair/Moderate Price<br><br>+ Nom nom Cocktails too<br><br>+ Strategic location<br><br>-<br>How the night ended???<br>As I have never been a fan of Munich, the evening couldnt have turned any better eventhough Chelsea didnt really deserve the cup. ;-) I left the venue hand in hand with my very love, rushed away walking in the pouring rain and jumped up into the cab with a secret wish : &#39;till we meet again&#39; ...",
