"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ua8W64vbpawPrtw4u8oL0Q/l.jpg",
"rating":"4.0",
"reviewcomment":"Osaka is a very nice chinese buffet with sushi and mongolian grill. It&#39;s quite small, but they make the most of the space by using smaller steamer trays on the hot buffet. I actually think this is a good idea because the food seems fresher.<br><br> The sushi was actually very appealing for a buffet. I had many items, and was pleased with the quality. Next to the sushi was a wide range of asian salads such as kimchi and bean sprout salad.<br><br> They also have a mongolian grill with all the ingredients you would expect. However, the grill chef only seems to come out from the kitchen when there are a few plates for him to cook. Once, we waited about 10 minutes for our plates to be prepared.<br><br> Our Japanese waitress was incredibly nice and prompt with service. She had limited English skills, but was very interested in learning from us how to say various words.",
