"rating":"3.5",
"reviewcomment":"French, seafood, expensive, downtown Fft.<br><br>It belongs to the Mook Group which means people either love it or hate it.  As with other restaurants in the group it&#39;s a statement kind of place... see and be seen, and not cheap.<br><br>On to it though.  The decor and ambiance is perhaps just a tad more Las Vegas than real French.  Lovely old building they brought back to life (they deserve some credit).  Was there with the oenophile, Mrs, S.  Foie Gras app was outstanding.  Boudin burger was a clever id.Just the plain Boudin Noir would have been better though.<br><br>Wines were good.   Neither over or under priced.  Selection as befit the price of entry.<br><br>Mains:  Mrs S had veal cutlet with roquefort and I had lambs leg with ratatouille.  Food was well prepared, no complaints.<br><br>Our tab was around €155. We had  a cremant, a  sazerac, and a bottle of wine from the mid range.  Nice experience but not the best experience I&#39;ve had for that money.",
