"rating":"3.5",
"reviewcomment":"After coming back from a business trip to the US, my two guys and I stopped by F&amp;F for an early dinner. <br>My husband and I actually ordered the same thing: The Frankfurt and Friends burger without bacon, but with added mushrooms and steakhouse fries. <br>Kiddo got a single order of fries.<br>The food was good - definitely one of the better burgers in Frankfurt - and the fries hit the spot as well. <br><br>The service was just A-OK. <br>Our waiter was friendly enough, but not super enthusiastic.<br>Also, I actually told him that I wanted the burger medium-rare, but it came well done.<br>Since the burger was good, it&#39;s no biggie, but there is certainly room for improvement.<br><br>Overall I enjoyed the visit and I love that they are using locally sourced beef. <br>I&#39;d come back and bring some of our out-of-country friends as well.",
