"reviewcomment":"A good chinese buffet with mongolian grill. They also offer sushi, but I didn&#39;t think it looked very fresh. I chose only to eat the cooked items.<br><br> The mongolian grill had a wide array of raw vegetables, meat, and seafood to build your perfect plate. For those unfamiliar with how mongolian grill works in Germany, your table has clothespins on it that you attach to your plate of raw ingredients. This is how the grill chef knows which plate belongs to you because the clothespin has your table number written on it. If the grill is backed-up with orders, you can just leave your plate behind and a waitress will bring it to you when it&#39;s cooked.",
