"reviewcomment":"For years, the Bockenheimer Weinkontor (wine depot) is one of the top recommendations in town (i.e. repeatedly Top 10 in Frankfurt geht aus-restaurant guide). No wonder, the place is a true original, wooden wine boxes as seats, the service (at the counter only, no service on the tables) always friendly, the wine recommendations good, as are the wines themselves.<br>Small snacks do not compete with a restaurant - but are yummy ;-) Bread with Salami or Cheese (decorated with salt sticks, chips and olives), a plate with cheese cubes (and olives), peanuts, such small dishes.<br><br> In summer, you can sit outside, which is on sublevel, but thanks to wonderful natural twines cover it&#39;s really cosy. In winter, the open fire place makes the plame cosily warm.",
