"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/NBym56uqPZeG_EFmtomjlQ/l.jpg",
"rating":"4.0",
"reviewcomment":"In Frankfurt ... or in Germany for that matter ... not all döner kebabs are created equal, and döner, lahmacun, and kebabs at Bistro Sahin were the best I&#39;ve had ... so much so that I&#39;m craving them as I&#39;m writing this review!  <br><br>The atmosphere of the restaurant is quaint in comparison to the other Turkish Imbisses in Frankfurt.  Much of it is due to the location of the restaurant which is situated in one of the more charming streets/neighborhood near the Goethe University ... also helps that the outdoor seating area faces a beautiful church and a market place.  <br><br>Although the service was curt at the take out counter, in the dining area, it was warm and friendly.  We ordered the grilled meat plate, which was delicious and massive, big enough for 2 people to share, and the baklava and their house tea, which were absolutely divine!  <br><br>When in Frankfurt, I definitely look forward to visiting this lovely neighborhood and Bistro Sahin.",
