"reviewcomment":"Fine place to go eat, watch sports and party. It is located in the back of the old stock exchange on the corner of the street (ex hard Rock Cafe). When there is sports event make sure you reserve a place cuz they get full quite fast. The food is quite good especially the burger, which tastes as if homemade and it comes with fried potatoes, and the portions are quite big. They offer a lot of different types of beer and cocktails. make sure you order the long island as it is very delicious. It costs 9 EUR, thus much more expensive than at other places, but it is quite good. You can watch sports inside on a huge beamer screen or outside on a flat screen tv. either way pure entertainment is guaranteed. On the weekends it turns out into a discotheque so you can dance inside.<br>cheers",
