"reviewcomment":"Quite a good bar/restaurant if you wanna have a nice burger and german beer; After a 4 hour train ride from Paris it was quite nice to have a good meal. The bar is 5 minutes walk from Frankfurt train station. You have the possibility to eat outside which is very enjoyable during the summer.<br>While eating you can watch bystanders going to the many bars and nightclubs located downtown. Since you are in the red light district area don&#39;t be amazed to see some nice ladies/dudes walking around.<br><br>The bar is nice, staff is cool. Restrooms are clean and you do have a cigarettes machine at the back (pretty common in Germany as I saw during my trip).<br><br>If you&#39;re staying around the train station for a couple of nights it is definitely a good place to eat.",
