"rating":"4.0",
"reviewcomment":"Etwas unscheinbar kommt Platz im Herzen daher. Eher zufällig war es daher auch, dass wir vor ca. 2 Jahren das erste Mal zum Frühstücken unseren Weg hierhin fanden.<br>Gleich auffällig war die etwas ungewöhnliche Kombination einiger Gerichte (z.B. Rührei mit Sucuk) sowie die nette Beratung bei der Bestellung durch den Besitzer.<br>War das Platz im Herzen dann in letzter Zeit etwas in Vergessenheit geraten, so hat es jetzt wieder an Aktualität gewonnen, da wir praktisch direkt in die Nachbarschaft gezogen sind. So kam es auch, dass wir unlängst wieder häufiger dort waren und was soll ich sagen? Immer super!<br>Sowohl die normale Karte mit Penne Platz im Herzen oder den Salaten als auch der Neujahrsbrunch waren echt toll und preislich fair.<br>Der Inhaber ist stets aufmerksam und sehr flexibel! Die Küche ist einfach toll und wir gehen immer wieder gern hin! Für mich eine absolute Empfehlung und zwar uneingeschränkt!",
