"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/v3H79-Xk0W-AyH7Uz8NIbw/l.jpg",
"rating":"4.0",
"reviewcomment":"I went to Mosebach for the first time in a mixed group of Frankfurt residents and foreigners. We were brought to the restaurant by a person who grew up in Frankfurt and who wanted to introduce the foreigners to a very good instantiation of the city&#39;s famous green sauce. She made a great choice! I liked Mosebach so much that, over the next week and a half, I came back twice more, bringing other people with me. Each time, I had something different and differently good: Green sauce with eggs, dumplings in a creamy sauce, and even their wild boar (I&#39;m not a strict vegetarian, apparently). The last time I was there, the waitress recommended a riesling that I enjoyed. <br><br>I found the atmosphere relaxing and inviting. The restaurant is usually lively, which gives it a warmth, but it is not overcrowded or loud. The decor has traditional elements, such as animal heads on walls and ceramic pitchers, but also amusing eccentricities of the owners. <br><br>I speak hardly any German, and this did not pose much of a problem. The waitstaff speak English and they provide English menus to those who ask. There is a lengthy list of specials written in German only, but the waitress kindly translated them for us.",
