"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/wjNSknSjNntmUGaVshjW-Q/l.jpg",
"rating":"3.5",
"reviewcomment":"Perfect lunch every time. For 3.80 Euros or 5 Euros for premium dishes. You can have delicious Chinese that is cooked fresh. If you are in a hurry for lunch I highly recommend getting your meal for take away. It always looks busy and is always busy, but they work quick to get your food to you. Even at the busiest times you can usually be in and out under 7 minutes. If you have more time to spare you can wait on a table. The staff is helpful and friendly but they work fast and in such a small place you can feel &#34;in the way&#34;. The fried rice is a must try as well as the curry dishes. I recommend the Duck with Cha Sha sauce as my favorite. I have been to other Chinese take aways in town and this place cannot be beat on price and value for what you get.",
