"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/tG-59slLNYqzoLw7zkMvEA/l.jpg",
"rating":"4.0",
"reviewcomment":"Reuben sandwiches in Frankfurt.<br><br>That just about says it all.  Over two decades I&#39;ve been here and somebody finally opens a kosher deli style shop right before I leave.  *sigh*<br><br>Anyway... bit of a hipsterish place in the  Bahnhofsviertel.  There is no outside signage and the proprietors are apparently proud of the graffiti on the exterior walls since they haven&#39;t bothered cleaning it off.  In sideis well renovated but relatively small so you might be sharing a table.<br><br>I had a reuben.   Small was nine something and the large 13 something.  At first I was taken aback by the price but the sandwich really is big.  Pastrami is homemade so nice and juicy from the oven and piled very high.  Like New York  deli high.  Cheese and kraut kind of got lost in there but hey, who ever complains about too much pastrami?  Not me.<br><br>Served with a pickle and a small portion of coleslaw.  Very good  sandwich.  However.... at around  €30 for Mrs. S and I to have  a good sandwich and a couple of sodas.... that&#39;s when you really consider just making it at home.<br><br>PS:  I love the fact that yelp  has an ambiance option called &#34;hipster&#34;.  Saves me moaning.",
