"rating":"3.5",
"reviewcomment":"Do you like asian food? Well I do and I must say this place is one of my favorites. They cook extremely good and are located on Konstablerwache, thus it is 10 mins from the city and 3 mins from Roemer and the river. The location is perfect - very quiet in a small street with view on the big square in front. In summer it is extremely nice to sit outside and dine. The portions that one gets are huge (my girlfriend cannot eat it, so we usually end up taking home 1/2 of her food :)). very friendly and clean. They are open until 12am so one can go there eat and then move on to the parties around the city, I mean everything is anyway in a walking distance.",
