"reviewcomment":"Despite restaurant being located in the heart of Frankfurt&#39;s sleazy red light district this is a wonderful place. The food is absolutely delicious and portions are large. Yelp calls this place a German restaurant but the food here is more like California Cuisine with it&#39;s emphasis on fresh, in season ingredients. I had the traditional French dish of mussels and fries and it was the best I have ever eaten any place in the world. The eggplant salad was exceptional. Other highlights on the menu was the sweet potato salad. On my next trip to Frankfurt I will definitely eat here again. My only complaint about the restaurant is that it got loud as the evening progressed.",
