"rating":"4.0",
"reviewcomment":"I get to go to Frankfurt about once every 4 years and Sachenhausen is a must. <br><br>Since I was driving my friends Chrysler 300 it was a real challenge just to find parking. I finally gave up and park illegally!!<br><br>We found this place by luck and as in the past the area is quite until you go inside. I just love the ambience of the place. We were placed between locals who were quite nice and helpful when it came to ordering.<br><br>Apple wine was a must, and I had to have my Schnitzel fix...All was excellent. <br><br>I recommend this place for any visitor. I will go back when I am in Frankfurt.",
