"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/YRarYx_etgvN-UedNrNJJg/l.jpg",
"rating":"2.5",
"reviewcomment":"Not easy to find a fair rating for this place. If you&#39;ve been to Chipotle in the U.S., you already know the ordering process. Basically, you decide whether you want a burrito or a burrito bowl and then tell the server which ingredients you want. There are a lot of bean variations, so if you&#39;re not a big fan of beans, this might not be your place. I loved the food, but there are several cons which make it an average location.<br><br>[Pro]<br>+ Food does taste great. Very tasty kinds of meat. Also mostly very healthy.<br>+ Very hip designed, industrial looking location<br>+ It&#39;s in a mall so when you&#39;re tired from lifting your girlfriend&#39;s shopping bags, this is a convenient location<br><br>[Con]<br>- Very, very overpriced! 9€ for an average taco bowl? Not only the main dish but they do charge you about 3€ for a small container of (very tasty) guac. Also very overpriced drinks. Not a big fan of their fancy lemonade choices.<br>- Nice location but easily crowded and then uncomfortable<br>- Somewhat limited food choices.<br><br>Basically a place I enthusiastically went to because I was craving U.S. / Mexican food. Loved the taste, but the con&#39;s are preventing me from going here regularly.",
