"rating":"4.0",
"reviewcomment":"Pretty good sushi place right in the middle of town at the base of the Deutsche Bank towers. Very well designed and inviting. Price-wise towards the higher end of the spectrum. Place was completely booked out the night we were there so we sat at the sushi bar. All the chefs are Japanese as far as I could tell. This is hopefully a good sign. Nevertheless, none of the service is. Fairly young staff and I found that they could have been a bit more attentive. Were polite but a bit disorganised and slow. I&#39;d come back as the quality of food was high and I enjoyed the ambiance. Hopefully service steps it up a notch though to match the price-point.",
