"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/GM-FR6NS5JciYrVCJcNMQg/l.jpg",
"rating":"3.5",
"reviewcomment":"Inside the Martim hotel, you can expect to pay quite a bit for your meal. However, even at EUR22, I found my lunch to be a decent value. I ordered the lunchbox #X03. It comes with miso soup, and has a very good variety of different food. You get some fried chicken, salmon, dumplings, sushi, oshinko, and salad.<br><br> I prefer that my sushi fish is cut from a large piece of fish when ordered. Here, everything seemed to be pre-cut. Especially for the price, I think this is unfortunate. The EUR9.50 large bottle of water was also upsetting.<br><br> Service was prompt and friendly even if the servers didn&#39;t have a good understanding of English.<br><br> If you&#39;re in Messe Frankfurt for a trade fair, I think it&#39;s worth walking just outside the fair to eat here. Compared to what you get for the cost in the exhibit hall, this place is no-brainer.",
