"rating":"3.5",
"reviewcomment":"As sad as it seems, the german critique were not very positive I agree, that the interior design is a bit lacking but again what are people expectig from a small business. I must say the price is definitely fair, for an average portion you get some pretty good stuff. Its pretty sad I that didnt write this is in german (Im working on my german skills!) but I want to say many of the people have ordered the wrong dishes. Most hilarious of all, most of the customers compared this CHINESE restaurant to a thai restaurant and ordered thai dishes what more can I say? . Even more unblievable is that they claim that Monkey bar served better. First, Monkey bar has seriously some first class dishes but doesnt it turn you off that it is cooked by a non asian chef? Where is the Authenticity?! I really hope the restaurant would soon offer some really good authentic food besides their great options of dim sum. I would categorize this a small, comfortable restaurant with family friendly atmosphere. Here, you are not rushed into eating and you all the time you need to enjoy some really good delicacies. Did I mention the prices? Seriously, cheap and good :D <br>Come by if you are looking for place where your friends and you can share a deep conversation, along with some dimsum.",
