"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Ar5RhCtacGm_cOzdUU4wug/l.jpg",
"rating":"3.0",
"reviewcomment":"Starbucks usually has mediocre coffee at high price, and many of them have poor furniture. The outside area is smokey and without a hint of separators, the inside not inspiring. The bartenders are even below-average Starbucks: Busy, unhappy, understaffed, committing errors, so in comparison with Meyerbeer or Fellows they lose. Even to the other local Starbucks, this is not a great place. Plus, the glass doors suck, esp. if your hands are full and you would like to get in or out. To be fair, the whole part of the shopping center is a crowded smoked mess with too many chairs and noise that echoes in a non-pleasant manner.<br>Starbucks coffee shops often are overheated, but this one is a sauna, and they keep those glass doors closed, probably to keep the smoke out. Why bother to change when u visit the near-by swimming pool? They would do well to prohibit smoking in the outside area, it&#39;s supposed to be an indoor mall, after all.",
