"rating":"4.0",
"reviewcomment":"La Bella is absolutely my favorite pizza anywhere in the world.<br>I started going during College (graduated in 2001) and even now that I live in the US (Texas y&#39;all) I make sure to come back every time I&#39;m in Germany. Even my wife and my two kids are nuts for the pizza here.<br><br>Probably because the pizza is absolutely perfect. Thin, tasty dough with delicious tomato sauce and generous, high-quality toppings. I wish they&#39;d be able to ship their pizza here (we really need to invent teleportation!).<br><br>--------------------------------------------------­-------------------------------------------<br><br>La Bella ist meine absolute Lieblingspizzeria.<br>Waehrend meiner Studienzeit (ugh. Abschluss 2001) kam ich regelmaessig hierher und selbst jetzt wo ich in den USA lebe stelle ich sicher, dass ich bei jedem Besuch nach Deutschland auch mal bei La Bella vorbeischaue. Sowohl meine Frau als auch meine beiden Kinder sind inzwischen genauso verrueckt auf die Pizza wie ich.<br><br>Die Pizza ist einfach perfekt, leckerer, duenner Teig, gute Tomatensosse und gut belegt. Rundrum perfekt!",
