"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Y2QbEYlM5nl955BMu0cH6g/l.jpg",
"rating":"3.5",
"reviewcomment":"Unfortunately I cannot say many positive things about this place, it is not that I haven&#39;t tried to like it over the years, but they simply never made a good impression. The only good thing about them is their location and that you can take the lift to get up, otherwise well The view from up there is really amazing and it is worth to go up there and make a few flix (just going there does not cost a penny, thus it is an alternative to the Main Tower). <br>The negatives: one should normally wait a while before finding a table; even after you have a table it takes a while to bring you the menu (god forbid if you don&#39;t know what you want to drink or eat); then some more time to bring you the stuff; and even longer to bring you the bill In addition, some of the things are not really of good quality or at I least I have eaten better ice-cream cakes, and the high prices are not comparable to the low quality.<br>Bottom line: go once, see for yourself but beware: pay as they bring you the things just in case you want to leave early.",
