"rating":"4.0",
"reviewcomment":"This used to be quite a good place for lunch when shopping in Frankfurt, nice people with good wine and very Italian food, forthcomming waiters gibbering in Italian phrases, not too pricey noodle dishes for under EUR10. What has happened ?, they have changed their style and bocome snooty, put up their prices, and even when the restaurant is relitively empty you need a lot of time before actually getting something to eat, I hope they will revoke to their old ways again and become again an easy crispy restaurant.<br>The Truffel Nudels had a very feint tast of Truffel but at EUR18.50 it is not worth ordering, The Duck breast in fig sauce was good meat but undercooked (Bloody) and the skin was very slopy, at EUR19.90 a bit steep,<br>The Rose wine at EUR3.50 the glass was wonderful, perhaps I should have drunk more in the almost 2 hours I was there.",
