"reviewcomment":"Relative to Manhattan, London, Berlin, or Istanbul, weekends in Frankfurt ain&#39;t happening. <br><br>My sister and her family lived in downtown Frankfurt for a few years and now moved to the yuppie neighborhood of Kronberg.  Whenever I visit Frankfurt, my expectation is simple - quality and cuddle time with my most favorite (and only) hapa niece and my little baby nephew.  I usually schedule my stay for Sunday through Thursday, so that I can fly to the next bubbly European city for a truly fun weekend adventure.<br><br>However, Tuesday nights is party night in downtown Frankfurt.  I still don&#39;t understand why the bankers prefer it that way, but that&#39;s how they roll.  During one summer visit, my sister and I met up with friends at Euro Deli - supposedly the hot happy hour spot to convene, drink and mingle with friends and strangers of Tuesday night.  The vibe was chill at the beginning of happy hour and thereafter the music and energy gradually escalated as the people poured into the bar then overflowed into the patio area.<br><br>The crowd is very international and banker&#39;s scene.  I breathe of refreshing fresh air from the dot-boom/bust, hipster, grunge and ecc scene of San Francisco and its neighboring quarters.<br><br>If you&#39;re in town for business or pleasure and you find yourself bored on a Tuesday night - do stop by forfor a drink or two and to explore what the evening has in store for you at the heart of downtown Frankfurt.",
