"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/A4V4eLa2OCO8RTRd1D0xdg/l.jpg",
"rating":"4.0",
"reviewcomment":"After quite a long sushi break, my husband and I had a craving again.<br>I cracked the whip and the googeling machine presented me with this gem: Sushi Bagan.<br>It is a small place just around the corner of the Allianz building in Sachsenhausen, but easy enough to find.<br>They offer a sushi buffet for lunch and dinner, but do a la carte sushi as well.<br>So far we have been there twice for the lunch buffet and 10,90 € will get you a wide selection of  sushi goodness.<br>I love the variety they offer.<br>They have all kinds of rolls, maki and nigiri with raw seafood, cooked tuna and veggies. There is something for everybody.<br>In addition, they also offer a small warm buffet with miso soup, steamed rice, fried rice, noodles, curry chicken, spicy chicken, some kind of beef dish, and shrimps.<br>3 types of ice cream will satisfy your sweet tooth at the end of your meal.<br><br>Their service is good too. <br>Very friendly people serve your drinks within 5 minutes.<br>You pay on your way out directly at the cash register which suits me just fine.<br>(I hate to wait for the bill anyways.)<br><br>In conclusion: <br>If you can do without sashimi, this is the place to go for good sushi at a great price.",
