"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/hqLo_jbMeNfvyPuQecfGKw/l.jpg",
"rating":"4.5",
"reviewcomment":"What a surprise to find such a great &#39;tapas&#39; restaurant in Germany! I spent my vacation in June in Catalonia, and Ponte could still be one of the best choices in any city in Costa Brava. <br><br>You can find all the traditional dishes, such as &#39;patatas bravas&#39; and &#39;chorizo&#39;. But don&#39;t forget to check the great seafood options, such as the octopus and the scallops (some of the highlights of the night).<br><br>I wish I could find a larger selection of Spanish wines to keep my illusion of being in the Spanish coast, but there&#39;s a reasonable selection by the glass or bottle. I highly recommend Ponte for a nice Spanish experience in Frankfurt. I&#39;d say it&#39;s particularly great if you go with a few friends - that way you can order lots of different tapas and have a little taste of everything!",
