"reviewcomment":"Tiny little hole in the wall Thai kitchen near the Hbf run by Thai people, and also a lot of Thai customers, which is a good sign. We tried the Panang (red curry) chicken and satay. Both were fine, but definitely not authentic. The panang sauce was very milky. It&#39;s the same problem at most Thai restaurants in Germany (except for Udon in Sachsenhausen) so I guess they just assume that westerners like it that way. It&#39;s not the cheapest place in town but not expensive either (mostly 6-9 Euro per dish). I noticed they serve Thai noodle soup in the afternoons which is hard to find outside of Thailand. I&#39;ll check that out next time.",
