"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/NrGXjRcFwI2kZsQOPcTaZQ/l.jpg",
"rating":"4.5",
"reviewcomment":"I used to live right around the corner from this place. It was my local cafe for about three years. I loved going here as the service was always nice and they knew you. The food was always good and I ate many dinners there with friends who also lived in the area. You could sit outside and relax on warm, sunny days yet it was just as comfortable inside. I recently stopped by when on business in Frankfurt and not much has changed. Still super service, quality food and drinks and a great addition to the area. This place must at this point be over 10 years old if not older. Quality has remained as I started going there literally 10 years ago. It&#39;s no longer necessarily the same people but the mood of service and the ambiance of the place have not changed. Well done and highly recommended by me.",
