"rating":"4.5",
"reviewcomment":"The most balanced espresso drink I have had the pleasure of sipping on the continent.  Not only is the product stellar, but the shop surrounding the espresso machine of great delight is so cute and cosy even the Danes would have no choice but to brand it &#39;hygge&#39;.  Beware trying to find a seat on an overcast afternoon indoors as there are few seats and fewer tables.  The weather was unseasonably warm on our visit, so we trucked ourselves out front and watched the passersby, cars and U-Bahn make their way down the road.  <br><br>The owners, perhaps a Frau and Mann team by the look of it, are both friendly and welcoming.  And, seriously, in a space this small, if the vibe weren&#39;t bueno, then you&#39;d not want to stay.  This would probably explain why the place was wall-to-wall customers on our visit.",
