"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/PPBkKQCddh3SEiebtmhFKA/l.jpg",
"rating":"3.5",
"reviewcomment":"Conveniently located near the Cathedral and the Historic Museum. <br><br>The interior decoration is charming, rustic, and very comfortable. <br><br>The menu proclaims typical Frankfurt cuisine and other German specialties. You will find Tafelspitz (boiled beef with a cold cold herbal sauce, Sauerbraten, pork knuckle dishes, and of course a few schnitzel dishes. I had Rouladen, which is not on the regular menu so I don&#39;t know whether they&#39;d have it every day. It&#39;s made with thinly sliced flank steak, rolled up with bacon, onions, pickles and mustard in the middle, and served with a wine/beer sauce. The beef itself is slightly dry, but eat it with the caramelized bacon-vegetable fillings and the wine sauce remedies the problem. The red cabbage side dish was wonderfully flavourful. <br><br>Apple strudel for dessert, not bad, not great. <br><br>Good services. They seem to handle large groups (there was a 15+ tour group) and small tables equally well.",
