"rating":"4.5",
"reviewcomment":"Mainlust &#34;Desche-Otto&#34; is a small and cosy apple wine tavern with a lovely garden, run by Claudia and Louie - in walking distance from where I live in Frankfurt am Main. Claudia and Louie&#39;s motto is &#34;hard-core Hessian&#34;. They strive for the &#34;not so usual&#34;, with delicious local fare with a modern touch, over 100 brandies (Louie&#39;s passion) and a  concert series during the summer months. In addition to the regular &#34;Haus Schoppen&#34; they have a second, special &#34;Haus Schoppen&#34; that changes when the barrel is drunk up.<br><br>For more see:<br><br><a href='/redir?url=http%3A%2F%2Fschiller-wine.blogspot.com%2F2013%2F03%2Fmainlust-desche-otto-ultra-traditional.html&amp;s=2809839e120ced852eceab972c1463023c00fc518eaa62ab20d7687cffc87269' target='_blank' rel='nofollow'>schiller-wine.blogspot.c…</a>",
