"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/yIL4rM_GBPfmfjZDs1YIow/l.jpg",
"rating":"3.0",
"reviewcomment":"We visit the Christmas Market in Frankfurt most years, always staying close to Zeil area and this has become our default breakfast stop off.<br><br>The staff are friendly and most speak good English. English menus are on offer but at this stage we kinda know the menu so don&#39;t both bother.<br><br>My usual is Zwei Eier Im Tasse, which translates to 2 Eggs in a cup, or in this case a glass. They  come with either brotchen (crispy roll) or toast. I usually get the roll.<br><br>The eggs are medium soft boiled, shelled and served in a glass with the bread on the side, and an enormous packet of butter. If you&#39;re used to the tiny individual sized packets you get here you;l be pleasantly surprised, it&#39;s more than enough. Coffee is also good quality.<br><br>They do a good selection of sweet and savoury baked goods as well, although we haven&#39;t really sampled them much. <br><br>This is a nice place to start a busy day&#39;s marketing, and provides enough for breakfast without being overfull for all the tasty meat and potato related treats that the market vendors have on offer.",
