"ogimage":"http://s3-media3.ak.yelpcdn.com/assets/2/www/img/76df14aad260/default_avatars/business_large_square.png",
"rating":"2.5",
"reviewcomment":"A solid choice for Chinese food in the city and within convenient reach of the Hbf (not necessarily a selling point as it is a less than salubrious area, but convenient if you pass through daily as a commuter to the city). The buffet is not such an appetising option and I would instead recommend one of the traditional hot-pots towards the back of the menu.<br><br> There are two entrances not easily located but persevere and you&#39;ll find them. Each leads to the restaurant on the upper floor.<br><br> Originally recommended to me via a Chinese member of the Toytown online community of English speakers in Germany, it was flagged as unusually authentic among Chinese restaurants in Frankfurt. The food is however somewhat greasy, particularly the deep friend spring rolls etc which do not appear to have been sufficiently drained and ooze oil as soon as you bite into them.<br><br> Stick to the hot pots and you&#39;ll have a good meal here.",
