"reviewcomment":"Haus Wertheym sits in the Old Town, right in the middle of all the tourists, so expect for prices to be on the higher side.  It&#39;s been around awhile (the House anyways, since the 1400s).  If you sit outside, go and sit down, the staff will bring you a menu and you can order, as long as you get their attention.  It was fairly empty when I went on a Saturday night (not a whole lot of people inside or out).  Food was decent- the pork scnitzel was good, probably enough for 2 people and the fries were good.  The side salad had too much dressing, which made it not that appetizing.  <br><br>Besides being pricey (4 euro for a .4L fanta), they only take cash.  Don&#39;t be like me and assume they take credit cards before ordering and eating",
