"rating":"4.0",
"reviewcomment":"I&#39;ve found that a lot of things are different between Germany and the US. For instance, in Germany:<br><br>Everyone is two feet taller than me.<br>All the cabs are Benzes. <br>Everyone speaks German.<br><br>I can&#39;t really think of any more right now, but the point is, that many things are different. One thing that remains true everywhere I&#39;ve ever been, is that everyone gets down to Billie Jean. <br><br>We sat at the First In for quite some time, drinking very decent albeit small martinis. There were 80s music videos on the entire time, the unintentional hilarity of which was unjustly being ignored by everyone in the bar other than us. However, as soon as Michael Jackson came on, people started to dance (or at least bob their heads awkwardly).<br><br>This is a nice little cocktail bar in a country that&#39;s all about beer. My Manhattan wasn&#39;t fantastic, but the aforementioned martinis went down quite easily, and the service was friendly. I&#39;d do it again.",
