"reviewcomment":"Really good place, it was introduced to me as the best Korean restaurant in Europe because so many Important Koreans go there when thy travel in Germany (hence the signatures on the wall). <br>To me it tasted good but not the way it tasted when i lived in Korea. My Korean friends told me that while restaurants in seoul kept evolving, this one remained traditional. <br>The service is excellent, they don&#39;t hesitate to advise you or explain to you how to eat things.<br>I took friends and collegues there, and even the ones that didn&#39;t know much about real Korean food liked it!",
