"categorystrlist":"Cocktail Bars,         Lounges,         Cafes,         Coffee & Tea",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/a9XAwSNMRh0yw0SfHMZRpA/l.jpg",
"rating":"4.5",
"reviewcomment":"One of the few proper smoking venues left in Frankfurt after the attempt by the barbarians to outlaw smoking completely, I hope that this gem remains intact for many years to come.<br>Situated in the backyard-basement of one of the houses adjacent to the old opera of Frankfurt, the lounge seems at first unassuming and a bit dark.<br>However the selection of drinks and the walk-in-humidor offer an ecclectic mix for the smoking-minded palate. The bartender is exceedinly competent and knowledgeable in spite of his young age and the cocktails meet a very high standard.<br>I thouroughly recommend this place to anyone looking for a quiet cosy cigar lounge in Frankfurt.<br>An added plus is the low mobile reception due to the lounge being in the basement, sparing one the louts that sometimes frequent the other notable cigar bar the Cigarrum in the Frankfurter Hof.",
