"rating":"5.0",
"reviewcomment":"Beautiful cafè with plenty attention to details. The extraordinaray friendly owner has a strong affinity for jazz, as you can tell. ;) Excellent coffee, one of the best in town!<br>Also, try the hot chocolate specialities, especially during autumn/winter. There is a separate tea and hot chocolate menue! You can have, for instance, dark hot chocalate with pistaccio or white hot chocolate. This is so yummie!<br>The cakes are delicios too, delivered every day freshly from a local bakerey and pastry shop. <br>There is a decent wine list to while away a lazy afternoon or evening. The Crémant d&#39;Alsace is my favourite (sparkling) wine, but the Gewurztraminer is worth a try, too.<br>Overall, an excellent café  as real cafés should be!",
