"rating":"3.0",
"reviewcomment":"Yes, I was also a (short time) Frankfurter who devoured this tiny Food Stall at the Hauptwache. A dear old friend who wasnt actualy a fan of such pricey FastFood introduced Chaang Thai to me ages ago as I was still at JWG Univ.<br><br>Yupe, love at the very first bite ;) No wonder the Q is always miles long during lunch time. At first I couldnt believe my eyes that even the Big Potatoes from the &#39;Börse&#39; nearby and bankers as well as the locals and tourists joining our line.<br><br>I got used to hot and spicy food ever since I was a little girl, so I always check the &#39;Sambal&#39; or Spicy Corner! Yupe, excellent as the rest of the dishes. As I dont consume such fast food daily, I pay less attention if the add some Glutamates or not.<br><br>-<br>As I&#39;ve been there quite often, I think I have to share one but simple bad experience from my latest visit.<br><br>They hardly had stuffs in the pots and my fave #4 was Sold Out... I hope the things in our tasteless cups (even 3 spoons Sambal didnt help) were because it was already very late afternoon and they just simple gave us their best rest! :)",
